ad_creative_bodies:
▼Mii de colegi liberali ne-am întâlnit, astăzi, la Craiova, cu trei zile înainte de o zi importantă pentru România: alegerile prezidențiale. Opțiunea mea și a celorlalți colegi este Nicolae Ciucă, din câteva rațiuni cât se poate de simple:
➥este un om cu o carieră în spate, nu un om pe care politica l-a făcut mare;
➥are studii făcute la vremea lor și știe pentru ce candidează; 
➥în cotextul războiului de la graniță, un profesionist în domeniul militar reprezintă o resursă importantă;
➥este diplomat, neconflictual, pro-european.
Restul… e can-can.
CMF 11240002

M-am născut și locuiesc în municipiul Pașcani, sunt căsătorit am doi copii și sunt candidat pentru Camera Deputaților din partea Partidul Național Liberal Iași.

Am 55 de ani, sunt inginer de profesie, am o experiență profesională de peste 35 de ani în domeniul energetic, serviciilor publice și antreprenoriat.

Am fost parlamentar și în acest mandat, din partea Partidul Național Liberal Iași și pot să spun că a fost un mandat intens.

Am avut onoarea să votez în plenul Parlamentului legi extrem de importante pentru județul Iași și întreaga zona a Moldovei:

● Finanțarea și demararea lucrărilor la autostrăzile A7 și A8;
● Acordul de împrumut pentru realizarea Spitalului Regional de Urgență Iași;
● Proiectul de investiții pentru aeroportul internațional Iași;
● Repornirea Acumulării Hidroenergetice Pașcani;
● Aprobarea Programului Național de Investiții ,,Anghel Saligny”;
● Aprobarea Planului Național de Redresare și Reziliență;
● Legi pentru susținerea IMM urilor fermierilor și antreprenorilor români.

Toate legile acestea sunt inițiative liberale și au fost promovate și implementate de guvernele conduse de premieri liberali.

De aceea este extrem de important ca pe 24 noiembrie să-l votăm pe Nicolae Ionel Ciucă președinte și România să aibă tot un Guvern liberal, care să continue politicile liberale și proiectele de investiții.

Sorin Năcuță
Candidat la Camera Deputaților
